import React from 'react';
import { useSelector } from 'react-redux';


function Cart() {
    const product = useSelector((state) => state.cart)
  return (
    <div>{
        product.map(product => (
            <div className='card' key={product.id}>
            <img  src={product.image}/>
            <h4>{product.title}</h4>
            <h5>{product.price}</h5>
            </div>
        ))
    }

    </div>
  )
}

export default Cart
